{"result":"@-moz-document domain("roblox.com") {
  /* Keyframes for animation */
  @keyframes wobble {
    0% {
      transform: rotate(0deg);
    }
    30% {
      transform: rotate(-30deg);
    }
    100% {
      transform: rotate(360deg);
    }
  }

  /* Logo animation */
  .icon-logo-r-95, .dark-theme .icon-logo-r-95 {
    animation: wobble 2s infinite;
  }

  /* Button styles */
  .btn-common-play-game-lg {
    border-radius: 18px;
    background: linear-gradient(to left, #29a97a, #01cd82, #29a97a);
    transition: transform 0.3s ease;
  }

  .btn-common-play-game-lg:hover {
    transform: scale(1.02);
  }

  .btn-common-play-game-lg:active {
    transform: scale(0.96);
  }

